import Header from './Header'
import AppContainer from './AppContainer'

const Loading = props => {
  return (
    <div>
      <Header loggedIn={props.loggedIn} />
      <AppContainer>
        <div className="avatar-lrg margin-top-xtr flex-horizontal-center flex-center-contents-vertically"><img className="center" src="/images/spinner.gif" /></div>
      </AppContainer>
    </div>
  )
}

export default Loading
